def median(l):
    l = sorted(l)
    if len(l) % 2 == 1:
        # length 3 -> index 1
        return l[(len(l) - 1) / 2]
    else:
        # length 2 -> average of index 1 and index 2
        return (l[(len(l) - 2) / 2] + l[(len(l) / 2)]) / 2

def format_sections(secs):
    return '%dm%ds' % (secs / 60, secs % 60)

def compute_attrs(table):
    rtn = []
    for row in table:
        new_row = dict(row)
        if 'file times' in row:
            times = tuple(j['user'] for j in row['file times'].values())
            new_row['files'] = len(times)
            new_row['total time'] = str(int(sum(times))) + 's'
            new_row['total time no m'] = str(int(sum(v['user'] for k, v in row['file times'].items()
                                                     if 'monoidal' not in k.lower() and 'enrich' not in k.lower()))) + 's'
            new_row['median time'] = '%0.01fs' % median(times)
            if 'big times' in row:
                for feature, time in row['big times'].items():
                    new_row[feature + '-frac'] = time / 20.0 / 10 # sum(times)
        if 'file stats' in row:
            stats = tuple(row['file stats'].values())
            new_row['lpf-mean'] = int(sum(i['lines'] for i in stats) / len(stats))
            new_row['lpf-median'] = int(median(i['lines'] for i in stats))
            if all('definitions' in i for i in stats):
                new_row['constr'] = sum(i['definitions'] for i in stats)
        rtn.append(new_row)
    return tuple(rtn)

