def transpose(l):
    return tuple(zip(*l))

def format_attr(attr):
    if attr == True:
        return r'\checkmark'
    elif attr == False:
        return ''
    else:
        return str(attr)

def format_get_attr(col, attr):
    after_format_attr = ''
    footnotemark = ''
    footnotetext = ''
    if attr + '-footnote' in col:
        footnotemark = r' \footnotemark'
        footnotetext = r'\footnotetext{' + col[attr + '-footnote'] + '}'
    if attr + '-frac' in col:
        after_format_attr += r'\makebox[0pt][l]{\leftfraction{%s}{\allstars}%s}%s' % (str(col[attr + '-frac']), footnotemark, footnotetext)
    else:
        after_format_attr += r'\makebox[0pt][l]{\relax%s}%s' % (footnotemark, footnotetext)
    if attr in col:
        return r'\phantom{\leftfraction{0.15}{\allstars}}' + format_attr(col[attr]) + after_format_attr + r'\phantom{\leftfraction{0.15}{\allstars}}'
    else:
        print('Warning: key %s has no attr %s' % (col['key'], attr))
        return format_attr('?')

def get_table():
    return transpose([[r'\multicolumn{1}{c|}{Construction}'] + [name for attr, name in ATTRIBUTES]]
                     + [[r'%s' % col['key']] + [format_get_attr(col, attr) for attr, name in ATTRIBUTES]
                        for col in TABLE])

def make_table():
    alignments = 'c' * len(TABLE)
    rtn = r"""\begin{center}
\begin{longtable}{l|%s}
""" % alignments
    rows = [' & '.join(row) for row in get_table()]
    rtn += rows[0] + r""" \\
\hline
\endhead
"""
    rtn += ' \\\\\n'.join(rows[1:])
    rtn += r"""
\end{longtable}
\end{center}
"""
    return rtn

def write_table():
    table = make_table()
    with open('comparison-table.tex', 'w') as f:
        f.write(table)

if __name__ == '__main__':
    write_table()
